import React, { useState } from "react";

function MainPage() {
  return (
    <div className="container">
      <div className="main-body">
        <div className="row">
          <div className="col-lg-12">
            <div className="card">
              <div className="card-body">
                <p>Hello all,</p>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}
export default MainPage;
